import React from "react";
import Card from "./card";
import "./styles.css";

function Stuff() {
  return (
    <div className="card-container">
      <Card
        url="./projects.jpg"
        alt="Projects"
        gridColumnStart="1"
        gridRowStart="1"
        key={1}
        name="My Projects"
      />
      <Card
        url="./blogs.jpg"
        gridColumnStart="2"
        gridRowStart="2"
        key={2}
        left="0%"
        right="90%"
        name="My Blogs"
      />
    </div>
  );
}

export default Stuff;
